$('.hover-effect').on('mousemove click', function (e) {
  var offset = $(this).offset();
  var clientX = e.clientX - offset.left;
  var clientY = e.pageY - offset.top;
  var lMouseX = Math.max(-100, Math.min(100, $('.hover-effect').width() / 2 - clientX));
  var lMouseY = Math.max(-100, Math.min(100, $('.hover-effect').height() / 2 - clientY));
  lFollowX = 12 * lMouseX / 100;
  lFollowY = 10 * lMouseY / 100;
  x += (lFollowX - x) * friction;
  y += (lFollowY - y) * friction;
  $(this).css({
    'transform': 'translate(0%, 0%) perspective(600px) rotateY(' + -x + 'deg) rotateX(' + y + 'deg)'
  });
});
$('.hover-effect').mouseout(function () {
  $(this).css({
    'transform': 'translate(0%, 0%) perspective(600px) rotateY(0deg) rotateX(0deg)'
  });
});

